import React from "react";
import  ReactDOM  from "react-dom";
import { responsive } from "./responsive.js";
import {S2} from './S2.js'
import { Side_bar } from "./side_bar.js";
import { Heading } from "./heading.js";
import img from './Dbms.png'
export class DBMS_header extends React.Component{
    constructor(){
        super()
        this.state=({style:responsive.DBMS()});
        this.resize=this.resize.bind(this)
        window.addEventListener('resize',this.resize)
        this.handleclick=this.handleclick.bind(this)
    }
    resize(){
        this.setState({style:responsive.DBMS()})
    }
    handleclick(){
        ReactDOM.render(<DBMS/>,document.getElementById('root'));
    }
    render(){
        return(
            <div style={this.state.style} onClick={this.handleclick}> 
                <S2 main={"DataBase Management"} topics={this.state.arr} img={img}/>
            </div>
        )
    }
}
class DBMS extends React.Component{
    constructor(props)
    {
        super(props)
        let arr=[['Data\ntypes',img],['Array',img],['String',img],['Pointers',img],['Classes',img],['Templates',img]]
        this.state={topics:arr}
    }
    render(){
        return(
            <div>
            <Heading/>
            <Side_bar arr={this.state.topics}/>
            </div>
        )
    }
}
